INSERT INTO `ROUTINES` VALUES ('init_account', 'def', 'login_killer', 'init_account', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN\r\n	DECLARE nameIndex INT(10) DEFAULT nStartIndex;\r\n	DECLARE szName CHAR(20) DEFAULT \'\' ;\r\n	DECLARE curCount INT(10) DEFAULT 0 ; \r\n	\r\n	WHILE curCount < nCount DO\r\n		SET curCount = curCount + 1 ;\r\n		SET szName = CONCAT(accountV,nameIndex)  ;\r\n		SET nameIndex = nameIndex+1 ;\r\n		\r\n		INSERT IGNORE INTO `t_account`(`account`, `password`, `privilege`) VALUES (szName, passwordV, nPrivilege);\r\n\r\n	END WHILE;\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2019-01-21 18:35:33', '2019-01-21 18:35:33', 'NO_ENGINE_SUBSTITUTION', '', 'root@localhost', 'utf8mb4', 'utf8mb4_general_ci', 'latin1_swedish_ci');
