INSERT INTO `VIEWS` VALUES ('def', 'salary', 'oneview', 'select `s`.`uid` AS `uid`,`s`.`month` AS `month`,`s`.`jbgz` AS `jbgz`,`s`.`cheb` AS `cheb`,`s`.`yj` AS `yj`,`s`.`canb` AS `canb`,`e`.`name` AS `name`,`s`.`id` AS `id`,cast((((cast(`s`.`jbgz` as signed) + cast(`s`.`canb` as signed)) + cast(`s`.`cheb` as signed)) + cast(`s`.`yj` as signed)) as char charset utf8mb4) AS `bz` from `salary`.`salary` `s` join `salary`.`emps` `e` where (`s`.`uid` = `e`.`uid`)', 'NONE', 'YES', 'root@localhost', 'DEFINER', 'utf8mb4', 'utf8mb4_general_ci');
INSERT INTO `VIEWS` VALUES ('def', 'salary', 'twoview', 'select `e`.`name` AS `name`,`r`.`id` AS `id`,`r`.`uid` AS `uid`,`r`.`time` AS `time`,`r`.`month` AS `month`,`r`.`type` AS `type` from `salary`.`emps` `e` join `salary`.`record` `r` where (`e`.`uid` = `r`.`uid`)', 'NONE', 'YES', 'root@localhost', 'DEFINER', 'utf8mb4', 'utf8mb4_general_ci');
